import React from 'react';

const List = ({list, instruments}) => {

    return (
        <div>
            <h3 className="listTitle">Lista:</h3>
            <table className="list">
                {
                instruments.map(item =>{
                    return (
                        <li>
                            <img className="image" src={item.picture} alt={item.name}/>
                            <span>{item.name}</span>
                        </li>
                    )
                })    
                }
            </table>
        </div>
    )
}

export default List;
